    };
  }

  render() {
   

    return (
      <Paper>
        <Scheduler
          data={schedulerData}
          height={660}
        >
          <WeekView
            startDayHour={9}
            endDayHour={19}
          />

          
          <AppointmentTooltip
            showCloseButton
            showOpenButton
          />
          <AppointmentForm
            readOnly
          />
        </Scheduler>
      </Paper>
    );
  }
}
